import React, { Component } from 'react';
import { PayrollEmployeeList } from './PayrollEmployeeList';
import { PayrollEmployee } from './PayrollEmployee';

export class Layout extends Component {
  static displayName = Layout.name;

    // eslint-disable-next-line no-useless-constructor
    constructor (props) {
      super(props);
      this.state = {
        showlist: true,
      };
    }

  render (employeeList) {
    return (
      <div className="Maindiv">
        <PayrollEmployeeList className={this.state.showlist? undefined : 'hidden'} ></PayrollEmployeeList>
        <PayrollEmployee className={this.state.showlist? 'hidden' : undefined} ></PayrollEmployee>
      </div>
    );
  }
}
